import React from "react";
import '../stylesheets/Tags.css'

function Tags ({ tags }) {
  return (
    <div className="tags">
      {tags.map((tag) => {
        <span class="badge badge-secondary">{tag}</span>
      })}
    </div>
  );
}

export default Tags;
